/**
 * @author Sven
 * @version 06/08/2021
 * Finds the distance between two points
 * @param a {x, y}
 * @param b {x, y}
 * @return {number} the distance between the vectors
 */
const vectorDistance = (a, b) => {
    return Math.sqrt(Math.pow(b.x - a.x, 2) + Math.pow(b.y - a.y, 2));
}

export default vectorDistance;
